import Foundation

open class MoveToFolderComponent: MBTComponent {
  public static let type: MBTComponentType = "MoveToFolderComponent"
  @discardableResult
  open func assertMatches(_ model: App, _ application: App) throws -> Void {
    let modelMoveToFolder: MoveToFolder! = MoveToFolderFeature.`get`.castIfSupported(model)
    let appMoveToFolder: MoveToFolder! = MoveToFolderFeature.`get`.castIfSupported(application)
    if modelMoveToFolder == nil || appMoveToFolder == nil {
      return
    }
    let modelFolderList = (try modelMoveToFolder.getFolderList())
    let appFolderList = (try appMoveToFolder.getFolderList())
    for folder in modelFolderList {
      (try assertTrue(appFolderList.includes(folder), "There is no folder \(folder)"))
    }
  }

  @discardableResult
  open func tostring() -> String {
    return self.getComponentType()
  }

  @discardableResult
  open func getComponentType() -> MBTComponentType {
    return MoveToFolderComponent.type
  }

}

